import './AboutUs.css' ;
import Carousel from 'react-bootstrap/Carousel' ;
import logoTitle from '../Photos/logoTitle.png';
import BackgroundSlider from 'react-background-slider';
import img2 from '../Photos/email.png' ;
import img3 from '../Photos/shutter1.png' ;
const AboutUs = () =>{
    function openNav() {
        document.getElementById("mySidebar").style.width = "250px";
        document.getElementById("main").style.marginLeft = "250px";
      }
      
      function closeNav() {
        document.getElementById("mySidebar").style.width = "0";
        document.getElementById("main").style.marginLeft= "0";
      }
    return(
        <>
      
        <BackgroundSlider
            images={[logoTitle,img2,img3]}
        duration={10} transition={2} />

<div id="mySidebar" className="sidebar">
  <a href="javascript:void(0)" className="closebtn" onclick={closeNav}>×</a>
  <a href="#">About</a>
  <a href="#">Services</a>
  <a href="#">Clients</a>
  <a href="#">Contact</a>
</div>

<div id="main">
  <button className="openbtn" onclick={openNav}>☰ Open Sidebar</button>  
  
</div>


            <div >
              
                <h1 className="title"> <img src={logoTitle} alt='logo' className="logo"></img>Title</h1>
            </div>

            <div id="seconddiv">
                About Us
            </div>

          <br></br>
          <br></br>
          <br></br>
          <br></br>

           
            <div>
                <button className="login" >Login</button> 
                <button className="signup" >Sign Up</button> 
            </div>
        </>
    );
} ;

export default AboutUs ;
